# # Bitmap Display Configuration:
# - Unit width in pixels: 8 (update this as needed)
# - Unit height in pixels: 8 (update this as needed)
# - Display width in pixels: 512 (update this as needed)
# - Display height in pixels: 512 (update this as needed)
# - Base Address for Display: 0x10008000 ($gp)
#
# Which milestones have been reached in this submission?
# (See the assignment handout for descriptions of the milestones)
# - Milestone 1-4 all completed
#
# Which approved features have been implemented for milestone 4?
# (See the assignment handout for the list of additional features)
# 1. Shoot enemies (2 marks) - The player has a bow that can shoot arrows
# 2. Enemies shoot back (2 marks) - The skeleton in the game can shoot back at us
# 3. Double jump (1 mark) - Player can jump once more mid air but only once until they land on solid ground or are using their bow to clutch onto a platform

# # Link to video demonstration for final submission:
# - YouTube: https://www.youtube.com/watch?v=Gq31JKrmLyI
# - If the YouTube link doesn't work, here is the Google Drive link: https://drive.google.com/file/d/1QKyTM6myJw0nUvcN_IWg5r2pAeg5JGeS/view?usp=sharing
#
# # Are you OK with us sharing the video with people outside course staff?
# - no
#
# # Any additional information that the TA needs to know:
# - Instructions, tap to move:
#	- w: jump
#	- a: left
#	- d: right
#	- q: quit
#	- r: restart
#	- <space>: shoot an arrow
# - You start out with 3 lives.
# - In this game, skeletons are invincible. I did this on purpose to make the game harder.
# - Collision with a zombie deals 1 life and collision with an arrow from a skeleton deals all 3 lives.
#
#####################################################################

# Addresses
.eqv BASE_ADDRESS 0x10008000
.eqv MAX_ADDRESS 0x1000c000	# max address for display
.eqv PLAYER_START_ADDRESS 0x1000b210	# Player start address (Main start address is 0x1000b210. A nice value to use for debugging is 0x10009F5c, 0x10009fd8)
.eqv KEYBOARD_ADDRESS 0xffff0000

.eqv PLAYER_WIDTH 24	# player's width in bytes
.eqv PLAYER_HEIGHT 40	# player's height in bytes
.eqv HEART_WIDTH 28
.eqv HEART_HEIGHT 28
.eqv JUMP_HEIGHT 6

.eqv PLATFORM_COLOR_1 0x926c4d	# Dirt platform color
.eqv PLATFORM_COLOR_2 0x637f40	# Grass platform color
.eqv ZOMBIE_BORDER_COLOR 0xff0000	# Zombie border color (red)
.eqv SKELETON_BORDER_COLOR 0xa8a8a8		# Skeleton border color (grey)
.eqv SKELETON_ARROW_COLOR 0		# Skeleton arrow color (black)


.data
newline: .asciiz "\n"

