	la $s3, playerFacingRightColors	# $s3 contains address for colors of current player (either facing right or left)
	lw $s4, jumpDistanceRemaining		# $s4 contains the jump distance remaining
	lw $s5, canDoubleJump		# $s5 contains whether or not the player can double jump
	lw $s6, playerArrowAddress		# $s6 contains address of the player's arrow
	
	la $t0, initialFirstLevel
	la $t1, firstLevel
	li $t2, 0
	ResetMapLoop:
		bge $t2, 4096, ResetMapLoopEnd
		lw $t3, 0($t0)
		sw $t3, 0($t1)
		addi $t0, $t0, 4
		addi $t1, $t1, 4
		addi $t2, $t2, 1
		j ResetMapLoop
	ResetMapLoopEnd:
	la $v1, firstLevel 	# $v1 contains address for current background colors
	j LoadLevel1
	
LoadGameOver:
	la $t0, gameOverColors
	la $t1, 0($s0)	# load BASE_ADDRESS into $t1
	
	la $t8, showGameOver
	lw $t9, 0($t8)
	beq $t9, 1, LoadGameOverEnd	# If Game Over screen is already shown, don't render it again
	li $t9, 1
	sw $t9, 0($t8)		# Otherwise, set the showGameOver flag to 1 to indicate that the Game Over screen is now shown
	
	DrawGameOver:
		bge $t1, $s1, LoadGameOverEnd	# loop until current address ($t1) is greater than or equal to MAX_ADDRESS
		lw $t2, 0($t0)		# $t2 = 0($t0), load the pixel from the background
		sw $t2, 0($t1)			# $t1 = 0($t2), store the background pixel into the bitmap
		addi $t0, $t0, 4
		addi $t1, $t1, 4
		j DrawGameOver
	LoadGameOverEnd:
	j GameLoop

LoadWinnerPage:
	la $t8, showWinnerPage
	lw $t9, 0($t8)
	beq $t9, 1, LoadWinnerPageEnd	# If Winner page is already shown, don't render it again
	li $t9, 1
	sw $t9, 0($t8)		# Otherwise, set the showWinnerPage flag to 1 to indicate that the Winner page is now shown
	
	jal LoadWinnerHearts	# Store the number of lives the player ended up with onto the winner page colors
	la $t0, winnerPageColors
	la $t1, 0($s0)	# load BASE_ADDRESS into $t1
	DrawWinnerPage:
		bge $t1, $s1, LoadWinnerPageEnd	# loop until current address ($t1) is greater than or equal to MAX_ADDRESS
		lw $t2, 0($t0)		# $t2 = 0($t0), load the pixel from the background
		sw $t2, 0($t1)			# $t1 = 0($t2), store the background pixel into the bitmap
		addi $t0, $t0, 4
		addi $t1, $t1, 4
		j DrawWinnerPage
	LoadWinnerPageEnd:
	j GameLoop

LoadLevel1:	# load level 1 to bitmap display
	jal LoadHearts
	la $t0, 0($v1)  # load the address of the background colors array into $t0
	la $t1, 0($s0)	# load BASE_ADDRESS into $t1
	DrawLevel1:
		bge $t1, $s1, DrawLevel1End	# loop until current address ($t1) is greater than or equal to MAX_ADDRESS
		lw $t2, 0($t0)		# $t2 = 0($t0), load the pixel from the background
		sw $t2, 0($t1)			# $t1 = 0($t2), store the background pixel into the bitmap
		addi $t0, $t0, 4
		addi $t1, $t1, 4
		j DrawLevel1
	DrawLevel1End:
	j DrawPlayer

LoadHearts:
	lw $t9, hearts	# $t9 contains the number of hearts the player has
	la $t0, 0($v1)
	addi $t0, $t0, 480
	li $t2, 0	# $t2 will loop from i = 0 to 3
	DrawHearts:
		bge $t2, 3, DrawHeartsEnd
		li $t3, 0	# $t3 will loop from j = 0 to 49	(the number of heart pixels)
		li $t4, 0	# $t4 will loop from k = 0 to 7 (the width of a heart)
		la $t5, heartColors
		DrawHeart:
			bge $t3, 49, DrawHeartEnd
				lw $t6, 0($t5)
				bge $t2, $t9, ReplaceHeartPixelWithBackgroundPixel
				beq $t6, 0xffffff, RenderHeartPixelEnd		# Don't load the white colors for the heart pixel
				sw $t6, 0($t0)
				j RenderHeartPixelEnd
				ReplaceHeartPixelWithBackgroundPixel:
					li $t6, 0x7fa9ff
					sw $t6, 0($t0)
				RenderHeartPixelEnd:
				addi $t5, $t5, 4
				addi $t0, $t0, 4
				addi $t4, $t4, 1
			bne $t4, 7, IncrementHeartCounter
			IncrementDrawHeartRow:
				addi $t0, $t0, 256
				addi $t0, $t0, -28
				li $t4, 0
			IncrementHeartCounter:
				addi $t3, $t3, 1
				j DrawHeart
		DrawHeartEnd:
		addi $t2, $t2, 1
		addi $t0, $t0, -1792
		addi $t0, $t0, -32
		j DrawHearts
	DrawHeartsEnd:
	jr $ra

LoadWinnerHearts:
	lw $t9, hearts	# $t9 contains the number of hearts the player has
	la $t0, winnerPageColors
	
	beq $t9, 3, WinnerHasThreeLives
	beq $t9, 2, WinnerHasTwoLives
	beq $t9, 1, WinnerHasOneLife
	
	WinnerHasThreeLives:
		addi $t0, $t0, 7320
		j FinishIncrementingWinnerHeartsStartPosition
	WinnerHasTwoLives:
		addi $t0, $t0, 7304
		j FinishIncrementingWinnerHeartsStartPosition
	WinnerHasOneLife:
		addi $t0, $t0, 7292
		j FinishIncrementingWinnerHeartsStartPosition
			
	FinishIncrementingWinnerHeartsStartPosition:
	
	li $t2, 7168	# $t2 loops from 7168 to 7168 + 256 * 7 = 8960 to unrender previous rendered hearts
	la $t8, winnerPageColors
	addi $t8, $t8, 7168
	UnrenderWinnerHearts:
		bge $t2, 8960, UnrenderWinnerHeartsEnd
		li $t3, 0xfffea7
		sw $t3, 0($t8)
		addi $t2, $t2, 4
		addi $t8, $t8, 4
		j UnrenderWinnerHearts
	UnrenderWinnerHeartsEnd:
	
	li $t2, 0	# $t2 will loop from i = 0 to 3
	
	DrawWinnerHearts:
		bge $t2, 3, DrawWinnerHeartsEnd
		li $t3, 0	# $t3 will loop from j = 0 to 49	(the number of heart pixels)
		li $t4, 0	# $t4 will loop from k = 0 to 7 (the width of a heart)
		la $t5, heartColors
		DrawWinnerHeart:
			bge $t3, 49, DrawWinnerHeartEnd
				lw $t6, 0($t5)
				bge $t2, $t9, ReplaceWinnerHeartPixelWithBackgroundPixel
				beq $t6, 0xffffff, RenderWinnerHeartPixelEnd		# Don't load the white colors for the heart pixel
				sw $t6, 0($t0)
				j RenderWinnerHeartPixelEnd
				ReplaceWinnerHeartPixelWithBackgroundPixel:
					li $t6, 0xfffea7
					sw $t6, 0($t0)
				RenderWinnerHeartPixelEnd:
				addi $t5, $t5, 4
				addi $t0, $t0, 4
				addi $t4, $t4, 1
			bne $t4, 7, IncrementWinnerHeartCounter
			IncrementWinnerDrawHeartRow:
				addi $t0, $t0, 256
				addi $t0, $t0, -28
				li $t4, 0
			IncrementWinnerHeartCounter:
				addi $t3, $t3, 1
				j DrawWinnerHeart
		DrawWinnerHeartEnd:
		addi $t2, $t2, 1
		addi $t0, $t0, -1792
		addi $t0, $t0, -32
		j DrawWinnerHearts
	DrawWinnerHeartsEnd:
	jr $ra
	
GameLoop:
	la $t9, KEYBOARD_ADDRESS	# Check for keyboard input
	lw $t8, 0($t9)
	
	beq $t8, 0, NoKeyPressed
		addi $sp, $sp, -4
		lw $t7, 4($t9)
		sw $t7, 0($sp)
		j HandleKeyPress
	NoKeyPressed:
		lw $t0, hearts 
		beqz, $t0, LoadGameOver		# Load Game Over Screen when all lives are lost
		sub $t3, $s2, $s0
		add $t4, $v1, $t3
		lw $t1, 0($t4)	# $t1 is the current background color at player's address
		beq $t1, 3487029, LoadWinnerPage		# Load Winner Page when the player has reached the door's color
		jal UpdateSkeletonArrowAddress
		lw $t0, isPlayerArrowInFlight
		beqz $t0, ProcessJumpMechanics	# If player's arrow is not in flight, then process jump behaviour
		jal DrawPlayerArrow
		ProcessJumpMechanics:
		bgtz $s4, JumpLoop
		beqz, $s4, ApplyGravity
	j GameLoop

UpdateSkeletonArrowAddress:
	la $t0, skeletonArrowAddress
	lw $t1, skeletonArrowAddress
	sub $t9, $t1, $s0
	move $t2, $v1
	add $t2, $t2, $t9	# $t2 stores the background address at the current arrow
	
	li $t9, SKELETON_ARROW_COLOR
	
	beq $t1, 268477948, SkeletonArrowBackgroundUnrenderEdgeCase
	beq $t1, 268477924, SkeletonArrowBackgroundUnrenderEdgeCase
	bge $t1, 268477928, SkipSkeletonArrowAddressBackgroundUpdate
	SkeletonArrowBackgroundUnrenderEdgeCase:
	li $t7, 0xd5e3ff
	sw $t7, 0($t2)	# Unrender the previous background pixel for the arrow
	beq $t1, 268477948, SkipSkeletonArrowAddressBackgroundUpdate
	beq $t1, 268477924, SkipSkeletonArrowAddressBackgroundUpdate
		addi $t2, $t2, 4	
		sw $t9, 0($t2)	# Render new background pixel for the arrow
		addi $t2, $t2, -4
	SkipSkeletonArrowAddressBackgroundUpdate:
	
	beq $t1, 0x1000a518, SkipUnrenderCurrentSkeletonArrow	# Don't unrender the past spot of arrow when in initial state
		addi $t2, $t2, -4
		lw $t8, 0($t2)
		addi $t1, $t1, -4
		sw $t8, 0($t1)
		addi $t2, $t2, 4
		addi $t1, $t1, 4
	SkipUnrenderCurrentSkeletonArrow:

	beq $t1, 268477948, ResetSkeletonArrow
	sw $t9, 0($t1)
	addi $t1, $t1, 4
	sw $t1, 0($t0)
	
	j ResetSkeletonArrowEnd
	ResetSkeletonArrow:
		li $t9, 0x1000a518
		sw $t9, 0($t0)
	ResetSkeletonArrowEnd:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal Sleep
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

CheckSkeletonArrowCollision:
	lw $t0, skeletonArrowAddress	# $t0 is skeleton arrow's current address
	move $t1, $s2	# $t1 is player's current address
	move $t2, $v1
	add $t2, $t2, $t9	# $t2 stores the background address at the current arrow
	lw $t3, 0($t2)	# $t3 stores the background color at the current arrow
	jr $ra

DrawPlayerArrow:
	lw $t1, isPlayerArrowInFlight
	beqz $t1, GameLoop
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
 	jal Sleep		# Sleep for frameRate seconds
 	lw $ra, 0($sp)
 	addi $sp, $sp, 4
 	
 	sub $t8, $s6, $s0
 	la $t9, 0($v1)
 	add $t9, $t9, $t8
 	
 	lw $t8, playerArrowDirection
 	beqz $t8, DrawPlayerArrowInitialSetupLeft
 	DrawPlayerArrowInitialSetupRight:
 		addi $t9, $t9, -4
 		j DrawPlayerArrowInitialSetupEnd
 	DrawPlayerArrowInitialSetupLeft:
 		addi $t9, $t9, 4
 	DrawPlayerArrowInitialSetupEnd:
 	
 	lw $t7, 0($t9)	# $t7 contains the background color of the map at the new arrow's address
	
	beq $t1, 2, UnrenderPreviousArrow
	
	# Case when isPlayerArrowInFlight = 1
	li $t9, 2
	la $t8, isPlayerArrowInFlight	# Set the player arrow to 'in flight' from 'just launched'
	sw $t9, 0($t8)
	li $t0, 0xcdcdcd
	sw $t0, 0($s6)	# Render the current arrow
	addi $s6, $s6, 4
	jr $ra
	j DrawPlayer

	UnrenderPreviousArrow:
		lw $t0, playerArrowDirection
		beq $t0, 0, UnrenderPreviousArrowLeft
		UnrenderPreviousArrowRight:
		addi $s6, $s6, -4
		beq $t6, 788, UnrenderPreviousArrowRightEnd	# Don't unrender previous arrow if the arrow is in start position
		sw $t7, 0($s6)	# Unrender the previous arrow
		addi $s6, $s6, 4
		UnrenderPreviousArrowRightEnd:
		j UnrenderArrowPixelEnd
	
		UnrenderPreviousArrowLeft:
		addi $s6, $s6, 4
		beq $t6, 768, UnrenderPreviousArrowLeftEnd	# Don't unrender previous arrow if the arrow is in start position
		sw $t7, 0($s6)	# Unrender the previous arrow
		addi $s6, $s6, -4
		UnrenderPreviousArrowLeftEnd:
	UnrenderArrowPixelEnd:

	li $t0, 256
	sub $t2, $s6, $s0
	div $t2, $t0
	mfhi $t3	# $t3 is x-coordinate of arrow address
	
	beq $t3, 252, SetPlayerArrowToNotInFlight	# Set player arrow back to default position if x-coord of arrow is 252
	beqz $t3, SetPlayerArrowToNotInFlight	# Set player arrow back to default position if x-coord of arrow is 0
	j SkipSettingPlayerArrow
	
	SetPlayerArrowToNotInFlight:
		lw $t1, playerArrowDirection
		beqz $t1, SetPlayerArrowToLeftHandSide
		SetPlayerArrowToRightHandSide:
			add $t0, $s2, 788
			j SetPlayerArrowSideEnd
		SetPlayerArrowToLeftHandSide:
			add $t0, $s2, 768
		SetPlayerArrowSideEnd:
		move $s6, $t0	# Update arrow location back to player's bow
		la $t1, isPlayerArrowInFlight
		li $t0, 0
		sw $t0, 0($t1)	# Set isPlayerArrowInFlight back to 0
		j DrawPlayer
	SkipSettingPlayerArrow:
	
	li $t0, 0xcdcdcd
	sw $t0, 0($s6)	# Render the current arrow
	
	lw $t1, playerArrowDirection
	beq $t1, 0, IncrementArrowLeft
	IncrementArrowRight:
		addi $s6, $s6, 4
		j IncrementArrowEnd
	IncrementArrowLeft:
		addi $s6, $s6, -4
	IncrementArrowEnd:
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	move $a0, $s6
	jal CheckArrowCollision
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	jr $ra

# Takes in an argument $a0 which is new address of the player's arrow
CheckArrowCollision:
	move $t0, $a0
		
	sub $t8, $t0, $s0
	la $t9, 0($v1)
 	add $t9, $t9, $t8
 	lw $t7, 0($t9)	# $t7 contains the background color of the map at the arrow's address	
 	
	lw $t1, playerArrowDirection
	beqz $t1, CheckArrowCollisionUnrenderAddressLeft
	CheckArrowCollisionUnrenderAddressRight:
		addi $t9, $t9, -8
		j CheckArrowCollisionUnrenderAddressEnd
	CheckArrowCollisionUnrenderAddressLeft:
		addi $t9, $t9, 8
	CheckArrowCollisionUnrenderAddressEnd:
	
 	li $t1, PLATFORM_COLOR_1
 	beq $t7, $t1, PlayerArrowCollidedFriendly
	li $t1, PLATFORM_COLOR_2
	beq $t7, $t1, PlayerArrowCollidedFriendly
	li $t1, SKELETON_BORDER_COLOR
	beq $t7, $t1, PlayerArrowCollidedFriendly
	li $t1, ZOMBIE_BORDER_COLOR
	beq $t7, $t1, PlayerArrowCollidedEnemy
	
	jr $ra
	
	PlayerArrowCollidedFriendly:
 		lw $t6, 0($t9)	# $t6 contains the background color of the map at the (arrow's address) - 8 or (arrow's address) + 8 
 		move $a0, $t6
		jal ResetPlayerArrow
		j DrawPlayer
	
	PlayerArrowCollidedEnemy:
 		lw $t6, 0($t9)	# $t6 contains the background color of the map at the (arrow's address) - 8 or (arrow's address) + 8 
 		move $a0, $t6
		jal ResetPlayerArrow
		addi $t9, $t9, 8
		move $a0, $t9 	# $a0 contains the address that the enemy got hit at
		jal EraseZombie
		j LoadLevel1

# Takes in an argument $a0 which is the address that the enemy got hit at
ResetPlayerArrow:
	la $t0, isPlayerArrowInFlight
	sw $zero, 0($t0)	# Set isPlayerArrowInFlight back to 0
	lw $t1, playerArrowDirection
	beqz $t1, ResetLeftShootingArrow
	ResetRightShootingArrow:
		addi $s6, $s6, -4
		j ResetShootingArrowEnd
	ResetLeftShootingArrow:
		addi $s6, $s6, 4
	ResetShootingArrowEnd:
	sw $a0, 0($s6)	# Unrender arrow with background color
	jr $ra

# Takes in an argument $a0 which is the address in the background that the zombie got hit with the player's arrow
EraseZombie:
	li $t3, 0		# $t3 loops from n = 0 to (# of zombies) = 2
	la $t4, zombieLocations		# $t4 contains address from the zombieLocations array for the zombie that collided
	ZombiesArrayLoop:
		bge $t3, 2, ZombiesArrayLoopEnd
		li $t8, 0 # $t8 loops from i = 0 to 10 (the height of a zombie)
		lw $t7, 0($t4)	# $t7 start at 0($t4) and goes till last pixel of zombie
		CheckWhichZombieCollided:
			bge $t8, 10, CheckWhichZombieCollidedEnd
				li $t9, 0	# $t9 loops from j = 0 to 6 (the width of a zombie)
				CheckWhichZombieCollidedInnerLoop:
					bge $t9, 6, CheckWhichZombieCollidedInnerLoopEnd
						beq $t7, $a0, ZombiesArrayLoopEnd
						addi $t7, $t7, 4
						addi $t9, $t9, 1
						j CheckWhichZombieCollidedInnerLoop
				CheckWhichZombieCollidedInnerLoopEnd:
				addi $t7, $t7, 256
				addi $t7, $t7, -24
				addi $t8, $t8, 1
				j CheckWhichZombieCollided
		CheckWhichZombieCollidedEnd:
		addi $t4, $t4, 4
		addi $t3, $t3, 1
	ZombiesArrayLoopEnd:
	lw $t2, 0($t4)	 # $t2 contains the address of the zombie that got hit
	li $t3, 0xd5e3ff	# $t3 = light blue background hex color
	li $t8, 0 # $t8 loops from i = 0 to 10 (the height of a zombie)
	EraseZombieLoop:
		bge $t8, 10, EraseZombieLoopEnd
			li $t9, 0	# $t9 loops from j = 0 to 6 (the width of a zombie)
			EraseZombieInnerLoop:
				bge $t9, 6, EraseZombieInnerLoopEnd
				sw $t3, 0($t2)
				addi $t2, $t2, 4
				addi $t9, $t9, 1
				j EraseZombieInnerLoop
			EraseZombieInnerLoopEnd:
			addi $t2, $t2, 256
			addi $t2, $t2, -24
			addi $t8, $t8, 1
			j EraseZombieLoop
	EraseZombieLoopEnd:
	jr $ra

JumpLoop:
	la $t0, 0($s2)
	move $a0, $t0
	addi $t0, $t0, -256
	move $a1, $t0
	jal IsMoveValid
	beq $v0, 0, JumpResultsInCollision
	
	addi $s4, $s4, -1
	j ShiftPlayerUp
	JumpResultsInCollision:
		li $s4, 0
		j GameLoop	

ApplyGravity:	
	jal IsPlayerOnAPlatform
	beq $v0, 1, DontShiftDown
	
	la $t0, 0($s2)
	move $a0, $t0
	addi $t0, $t0, 256
	move $a1, $t0
	jal IsMoveValid
	beq $v0, 0, DontShiftDown
	
	j ShiftPlayerDown
	
	DontShiftDown:
		j GameLoop


# Return value is in $v0
IsPlayerOnAPlatform:
	la $t0, 0($s2)
	addi $t0, $t0, 2564	# The address of the row after the player's left foot (2308 + 256 = 2564)
	sub $t2, $t0, $s0	# $t2 = offset between player's left foot and starting bitmap address
	la $t3, 0($v1)
	add $t3, $t3, $t2
	lw $t4, 0($t3)	# $t4 = Background color at player's left foot
	lw $t5, 0($t3)	# $t5 = Background color at player's right foot
	li $t6, PLATFORM_COLOR_1
	li $t7, PLATFORM_COLOR_2
	beq $t4, $t6, PlayerIsOnPlatform
	beq $t4, $t7, PlayerIsOnPlatform
	beq $t5, $t6, PlayerIsOnPlatform
	beq $t5, $t7, PlayerIsOnPlatform
	j PlayerIsNotOnPlatform
	PlayerIsOnPlatform:
		li $v0, 1
		jr $ra
	PlayerIsNotOnPlatform:
		li $v0, 0
		jr $ra
		
HandleKeyPress:
	lw $t7, 0($sp)
	addi $sp, $sp, 4
	beq $t7, 0x71, HandleKeyExit		# Exit the game when the 'q' key is pressed
	beq $t7, 0x72, HandleKeyR			# Reset the game when the 'r' key is pressed
	
	lw $t0, showGameOver 
	beq, $t0, 1, GameLoop		# Don't respond to the 'w', 'a', 'd', or <space> keys when game over page is shown
	lw $t0, showWinnerPage
	beq, $t0, 1, GameLoop		# Don't respond to the 'w', 'a', 'd', or <space> keys when Winner page is shown
	
	beq $t7, 0x61, HandleKeyA			# Shift the player left when the 'a' key is pressed
	beq $t7, 0x64, HandleKeyD			# Shift the player right when the 'd' key is pressed
	beq $t7, 0x77, HandleKeyW			# Make the player jump when the 'w' key is pressed
	beq $t7, 0x20, HandleKeySpace		# Shoot an arrow when the <space> key is pressed
	j GameLoop

HandleKeyA:
	move $a0, $s2	# $a0 contains the player's old address before moving
	addi $a1, $s2, -4	# $a1 contains the player's new address after moving left
	jal IsMoveValid
	beq $v0, 0, GameLoop	# This check ensures that the player cannot move past the left edge of screen 
	la $t0, isPlayerFacingRight
	li $t1, 0
	sw $t1, 0($t0)	# Change isPlayerFacingRight to 0
	la $t0, playerFacingLeftColors
	move $s3, $t0	# Change colors from playerFacingRightColors to playerFacingLeftColors
	j ShiftPlayerLeft		

HandleKeyD:
	move $a0, $s2	# $a0 contains the player's old address before moving
	addi $a1, $s2, 4	# $a1 contains the player's new address after moving right
	jal IsMoveValid
	beq $v0, 0, GameLoop		# This check ensures that the player cannot move past the right edge of screen
	la $t0, isPlayerFacingRight
	li $t1, 1
	sw $t1, 0($t0)	# Change isPlayerFacingRight to 1
	la $t0, playerFacingRightColors
	move $s3, $t0	# Change colors from playerFacingLeftColors to playerFacingRightColors
	j ShiftPlayerRight

HandleKeyW:
	jal IsPlayerOnAPlatform
	li $t9, JUMP_HEIGHT		# $t9 contains the constant JUMP_HEIGHT
	beq $v0, 0, HandleKeyWFallingCase	# Handle falling case when player is not on a platform
			
	li $s5, 1
	add $s4, $s4, $t9
	j HandleKeyWEnd
	
	HandleKeyWFallingCase:
		la $t0, 0($s2)
		move $a0, $t0
		addi $t0, $t0, 256
		move $a1, $t0
		jal IsMoveValid
		beq $v0, 0, DontLoseDoubleJump		# If there is collision and player is not on a platform, then player should not lose double jump as they are suspended midair
		beq $s5, 1, LoseDoubleJump
		j HandleKeyWEnd
		LoseDoubleJump:
			li $s5, 0
			addi $s4, $s4, 4
			j HandleKeyWEnd
		DontLoseDoubleJump:
			li $s5, 1
			addi $s4, $s4, 4
			j HandleKeyWEnd
	
	HandleKeyWEnd:
	j GameLoop

HandleKeySpace:
	la $t0, isPlayerArrowInFlight
	lw $t9, 0($t0)
	bnez $t9, GameLoop	# If player's arrow is in flight, then clicking <space> shouldn't fire another arrow
		
	# Update player arrow address and direction depending on player direction
	la $t8, playerArrowDirection
	lw $t4, isPlayerFacingRight
	beq $t4, 0, HandlePlayerFacingLeft
	HandlePlayerFacingRight:
		addi $t3, $s2, 788
		move $s6, $t3
		li $t1, 1
		sw $t1, 0($t8)
		j HandlePlayerFacingEnd
	HandlePlayerFacingLeft:
		addi $t3, $s2, 760
		move $s6, $t3
		li $t1, 0
		sw $t1, 0($t8)
	HandlePlayerFacingEnd:
	
	li $t1, 1
	sw $t1, 0($t0)	# Set the isPlayerArrowInFlight flag to 1
	j GameLoop

HandleKeyR:
	li $t0, 3
	la $t1, hearts
	sw $t0, 0($t1)	# Replenish number of hearts back to 3
	li $t0, 0
	
	la $t1, playerArrowAddress
	li $t2, PLAYER_START_ADDRESS
	addi $t2, $t2, 788
	sw $t2, 0($t1)	# Update arrow address back to player's starting position
	la $t1, playerArrowDirection
	li $t2, 1
	sw $t2, 0($t1)	# Update arrow direction back to the initial direction, which is right
	
	la $t1, showGameOver
	sw $t0, 0($t1)	# Set the showGameOver flag back to 0 to indicate that the Game Over screen is not shown after restarting game
	la $t1, showWinnerPage
	sw $t0, 0($t1)	# Set the showWinnerPage flag back to 0 to indicate that the Winner page is not shown after restarting game
	j main
	
HandleKeyExit:
	j END

ShiftPlayerLeft:
	lw $t0, isPlayerArrowInFlight
	bnez $t0, ShiftPlayerLeftDontUpdateArrow
	addi $s6, $s6, -4
	ShiftPlayerLeftDontUpdateArrow:
	addi $s2, $s2, -4
	j DrawPlayer
	
ShiftPlayerRight:
	lw $t0, isPlayerArrowInFlight
	bnez $t0, ShiftPlayerRightDontUpdateArrow
	addi $s6, $s6, 4
	ShiftPlayerRightDontUpdateArrow:
	addi $s2, $s2, 4
	j DrawPlayer

ShiftPlayerUp:
	lw $t0, isPlayerArrowInFlight
	bnez $t0, ShiftPlayerUpDontUpdateArrow
	addi $s6, $s6, -256
	ShiftPlayerUpDontUpdateArrow:
	addi $s2, $s2, -256
	jal Sleep
	j DrawPlayer

ShiftPlayerDown:
	lw $t0, isPlayerArrowInFlight
	bnez $t0, ShiftPlayerDownDontUpdateArrow
	addi $s6, $s6, 256
	ShiftPlayerDownDontUpdateArrow:
	addi $s2, $s2, 256
	jal Sleep
	j DrawPlayer


# Takes in an argument $a0 representing the old address of player and $a1 representing the current address of the player
# Sets $v0 to 0 if the move is invalid, sets $v1 to 1 if the move is valid
IsMoveValid:
	move $t0, $a0
	move $t1, $a1
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	addi $sp, $sp, -4
	sw $t0, 0($sp) 
	addi $sp, $sp, -4
	sw $t1, 0($sp) 
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	jal CheckCollision		# Check if the new address of the player causes a collision, result of $v0 = 0 means no collision and $v0 = 1 means collision
	lw $t1, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	addi $sp, $sp, 4
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	beq $v0, 1, MoveIsInvalid
	
	li $t2, 256
	div $t0, $t2
	mfhi $t3	# $t3 is the player's old x-coordinate
	div $t1, $t2
	mfhi $t4	# $t4 is the player's new x-coordinate
	sub $t5, $t3, $t4	# $t5 = (player's old x-coordinate) - (player's new x-coordinate)
	sub $t6, $t4, $t3	# $t6 = (player's new x-coordinate) - (player's old x-coordinate)
	
	lw $t7, isPlayerArrowInFlight	# When the player's arrow is in-flight, make it so that they have a little extra space to their left/right
	beqz $t7, FinishProcessMoveValidArrow
	beq $t5, -252, MoveIsValid
	beq $t5, 252, MoveIsValid
	beq $t6, -252, MoveIsValid
	beq $t6, 252, MoveIsValid
	FinishProcessMoveValidArrow:
	
	bge $t4, 236, MoveIsInvalid		# If (player's new x-coordinate) >= 236, then move is invalid
	ble $t5, 4, MoveIsValid		# If (player's old x-coordinate) - (player's new x-coordinate) <= 4, then move is valid
	ble $t6, 4, MoveIsValid		# If (player's new x-coordinate) - (player's old x-coordinate) <= 4, then move is valid
	MoveIsInvalid:
		li $v0, 0
		j IsMoveValidEnd
	MoveIsValid:
		li $v0, 1
	IsMoveValidEnd:
		jr $ra

# Returns $v0 which is 1 if there is collision and 0 if no collision
CheckCollision:
	lw $t0, 0($sp)	# $t0 is the player's new starting address
	addi $sp, $sp, 4
	la $t7, 0($s3)		# $t7 contains the current player color address
	la $t8, 0($v1)	# $t8 keeps track of the address for the background colors of the current level
	la $t9, 0($s0)		# $t9 keeps track of the base address for the bitmap
	sub $t2, $t0, $t9
	add $t8, $t8, $t2		# $t8 = address for background colors at player's new address
	
	li $t1, 0		# $t1 tracks whether there has been a collision (0 = no collision, 1 = collision)
	li $t2, 0 	# $t2 is a looping variable that goes from i = 0 to 10
	
	lw $t9, isPlayerArrowInFlight
	
	CheckCollisionLoop:
		bge $t2, 10, CheckCollisionEnd
			li $t3, 0		# $t3 is a looping variable that goes from j = 0 to 6
			CheckCollisionInnerLoop:
				bge $t3, 6, CheckCollisionInnerLoopEnd
				lw $t6, 0($t7)	# $t6 = background color of the current player color pixel
				beq $t6, 0xffffff, CheckCollisionInnerLoopIncrement	# Because the transparaent player color pixels (i.e. white color pixels) should not be used in collisions
				
				lw $t9, isPlayerArrowInFlight
				beqz $t9, CheckCollisionSkipCheckPlayerArrow
				beq $t6, 0xcdcdcd, CheckCollisionInnerLoopIncrement	# Because an in-flight player's arrow should not be used in collision
				CheckCollisionSkipCheckPlayerArrow:
				
				lw $t6, 0($t8)	# $t6 = background color of the current address from $t8
				li $t5, ZOMBIE_BORDER_COLOR
				beq $t6, $t5, CollisionWithZombieAtPixel
				li $t5, SKELETON_ARROW_COLOR
				beq $t6, $t5, CollisionWithSkeletonArrowAtPixel
				li $t5, PLATFORM_COLOR_1
				beq $t6, $t5, CollisionWithFriendlyUnitAtPixel
				li $t5, PLATFORM_COLOR_2
				beq $t6, $t5, CollisionWithFriendlyUnitAtPixel
				li $t5, SKELETON_BORDER_COLOR
				beq $t6, $t5, CollisionWithFriendlyUnitAtPixel
				j CheckCollisionInnerLoopIncrement
				CollisionWithFriendlyUnitAtPixel:
					li $t1, 1
					j CheckCollisionEnd
				CollisionWithZombieAtPixel:
					li $t1, 1
					la $t5, hearts
					lw $t6, 0($t5)
					addi $t6, $t6, -1
					sw $t6, 0($t5)	# Decrement the number of lives by 1 after collision with zombie
					lw $t6, isPlayerFacingRight
					beq $t6, 1, CollisionResultsInKnockbackToTheLeft
					CollisionResultsInKnockbackToTheRight:
						addi $s2, $s2, 8		# Knockback of 8 pixels to the right
						j CollisionKnockbackEnd
					CollisionResultsInKnockbackToTheLeft:
						addi $s2, $s2, -8		# Knockback of 8 pixels to the left
					CollisionKnockbackEnd:
					j LoadLevel1
				CollisionWithSkeletonArrowAtPixel:
					li $t1, 1
					la $t5, hearts
					li $t6, 0
					sw $t6, 0($t5)	# Decrement the number of lives by 3 after collision with skeleton arrow
					j GameLoop
				CheckCollisionInnerLoopIncrement:
					addi $t3, $t3, 1
					addi $t8, $t8, 4
					addi $t7, $t7, 4
					j CheckCollisionInnerLoop
			CheckCollisionInnerLoopEnd:
			addi $t2, $t2, 1
			addi $t8, $t8, 256
			addi $t8, $t8, -24
			j CheckCollisionLoop
	CheckCollisionEnd:
	
	move $v0, $t1
	jr $ra

	
DrawPlayer:
	bge $s2, $s1, PlayerFallenOffMap		# If player has fallen off the map, then restart player position
	
	la $t0, 0($s3)	# $t0 contains current address for the player colors
	move $t1, $s2 # $t1 contains the current address for the player on the bitmap
	
	la $t9, 0($v1)	# $t9 contains current address for the background colors
	sub $t8, $t1, $s0	# $t8 contains difference between player address and bitmap start address
	add $t9, $t9, $t8
	
	# Unrender column to the left of player
	addi $t7, $t1, -4
	addi $t8, $t9, -4
	li $t2, 0 # $t2 is a looping variable that starts at 0
	UnrenderLeftColumn:
		bge $t2, 10, UnrenderLeftColumnEnd
			lw $t4, 0($t8)	# $t4 = 0($t9), load the pixel color from the background
			sw $t4, 0($t7)	# $t1 = 0($t4), store the background color pixel into the bitmap
			addi $t7, $t7, 256
			addi $t8, $t8, 256
			addi $t2, $t2, 1
			j UnrenderLeftColumn
	UnrenderLeftColumnEnd:
	
	# Unrender column to the right of player
	addi $t7, $t1, 24
	addi $t8, $t9, 24
	li $t2, 0 # $t2 is a looping variable that starts at 0
	UnrenderRightColumn:
		bge $t2, 10, UnrenderRightColumnEnd
			lw $t4, 0($t8)	# $t4 = 0($t9), load the pixel color from the background
			sw $t4, 0($t7)	# $t1 = 0($t4), store the background color pixel into the bitmap
			addi $t7, $t7, 256
			addi $t8, $t8, 256
			addi $t2, $t2, 1
			j UnrenderRightColumn
	UnrenderRightColumnEnd:
	
	# Unrender row to the top of player
	addi $t7, $t1, -256
	addi $t8, $t9, -256
	li $t2, 0 # $t2 is a looping variable that starts at 0
	UnrenderTopRow:
		bge $t2, 6, UnrenderTopRowEnd
			lw $t4, 0($t8)	# $t4 = 0($t9), load the pixel color from the background
			sw $t4, 0($t7)	# $t1 = 0($t4), store the background color pixel into the bitmap
			addi $t7, $t7, 4
			addi $t8, $t8, 4
			addi $t2, $t2, 1
			j UnrenderTopRow
	UnrenderTopRowEnd:
	
	# Unrender row to the bottom of player
	addi $t7, $t1, 2560
	addi $t8, $t9, 2560
	li $t2, 0 # $t2 is a looping variable that starts at 0
	UnrenderBottomRow:
		bge $t2, 6, UnrenderBottomRowEnd
			lw $t4, 0($t8)	# $t4 = 0($t9), load the pixel color from the background
			sw $t4, 0($t7)	# $t1 = 0($t4), store the background color pixel into the bitmap
			addi $t7, $t7, 4
			addi $t8, $t8, 4
			addi $t2, $t2, 1
			j UnrenderBottomRow
	UnrenderBottomRowEnd:
	
	li $t2, 0 # $t2 is a looping variable that starts at 0
	li $t3, 0	# $t3 will increment by 1 from 0 to 36 to indicate when to increment the y-coordinate
	DrawPlayerLoop:
		bge $t2, 60, DrawPlayerEnd
			lw $t4, 0($t0)	# $t4 = 0($t0), load the pixel color from the player
			beq $t4, 0xffffff, RenderPlayerBackgroundPixel		# Don't load the white colors for the player pixel
			bne $t4, 0xcdcdcd, ProcessPlayerPixel	# 0xcdcdcd is color of player's arrow
			lw $t8, isPlayerArrowInFlight
			bnez $t8, RenderPlayerBackgroundPixel		# Don't load the player's arrow if player's arrow is in flight
			ProcessPlayerPixel:
				sw $t4, 0($t1)	# $t1 = 0($t4), store the player color pixel into the bitmap
				j RenderPlayerPixelEnd
			RenderPlayerBackgroundPixel:
				lw $t4, 0($t9)	# $t4 = 0($t9), load the pixel color from the background
				sw $t4, 0($t1)	# $t1 = 0($t4), store the background color pixel into the bitmap
			RenderPlayerPixelEnd:
				addi $t0, $t0, 4
				addi $t1, $t1, 4
				addi $t9, $t9, 4
				addi $t2, $t2, 1
				addi $t3, $t3, 1
				bne $t3, 6, RenderPlayerSkipIncrementRow
			RenderPlayerIncrementRow:
				addi $t1, $t1, -4
				addi $t1, $t1, 256
				addi $t1, $t1, -20
				addi $t9, $t9, -4
				addi $t9, $t9, 256
				addi $t9, $t9, -20
				li $t3, 0
			RenderPlayerSkipIncrementRow:
				j DrawPlayerLoop
	DrawPlayerEnd:
		j GameLoop

PlayerFallenOffMap:
	# Unrender row to the top of player
	la $t0, 0($s3)	# $t0 contains current address for the player colors
	move $t1, $s2 # $t1 contains the current address for the player on the bitmap
	la $t9, 0($v1)	# $t9 contains current address for the background colors
	sub $t8, $t1, $s0	# $t8 contains difference between player address and bitmap start address
	add $t9, $t9, $t8
	addi $t7, $t1, -256
	addi $t8, $t9, -256
	li $t2, 0 # $t2 is a looping variable that starts at 0
	PlayerFallenOffMapUnrenderTopRow:
		bge $t2, 6, PlayerFallenOffMapUnrenderTopRowEnd
			lw $t4, 0($t8)	# $t4 = 0($t9), load the pixel color from the background
			sw $t4, 0($t7)	# $t1 = 0($t4), store the background color pixel into the bitmap
			addi $t7, $t7, 4
			addi $t8, $t8, 4
			addi $t2, $t2, 1
			j PlayerFallenOffMapUnrenderTopRow
	PlayerFallenOffMapUnrenderTopRowEnd:
	
	# Decrement the number of hearts by 1
	la $t3, hearts
	lw $t4, 0($t3)
	addi $t4, $t4, -1
	sw $t4, 0($t3)
	
	la $s2, PLAYER_START_ADDRESS
	j LoadLevel1


Sleep:
	lw $t0, frameRate		# sleeps game for 'frameRate' miliseconds
	li $v0, 32			# system call for sleep
	move $a0, $t0
	syscall
	jr $ra

# To call this Debug function, use the following format
# 	move $s7, $tk
#	jal Debug
Debug:
	li $v0, 1
	move $a0, $s7
	syscall
	li $v0, 4
	la $a0, newline
	syscall
	jr $ra

END:
	li $v0, 10 # terminate the program gracefully
	syscall 
